import styled from 'styled-components';
import { motion } from 'framer-motion';

const AboutSection = styled.section`
  background: ${({ theme }) => theme.gradients.purple};
  padding: 0 2rem 6rem;
  color: white;
  margin-top: -2px;
  position: relative;
  overflow: hidden;

  &::before {
    content: '';
    position: absolute;
    top: -50%;
    left: -50%;
    width: 200%;
    height: 200%;
    background: 
      radial-gradient(circle at 50% 50%, rgba(255, 255, 255, 0.2) 0%, transparent 40%),
      radial-gradient(circle at 30% 50%, rgba(255, 255, 255, 0.15) 0%, transparent 50%),
      radial-gradient(circle at 70% 50%, rgba(255, 255, 255, 0.15) 0%, transparent 50%);
    animation: rotate 30s linear infinite;
    pointer-events: none;
    opacity: 0.4;
    mix-blend-mode: soft-light;
  }

  @keyframes rotate {
    from {
      transform: rotate(0deg);
    }
    to {
      transform: rotate(360deg);
    }
  }
`;

const Container = styled.div`
  max-width: 1400px;
  margin: 0 auto;
  padding-top: 6rem;
`;

const Header = styled.div`
  text-align: center;
  margin-bottom: 4rem;
`;

const Title = styled.h2`
  font-size: 2.5rem;
  color: #00FFFF;
  margin-bottom: 1rem;
`;

const Subtitle = styled.h3`
  font-size: 2rem;
  color: white;
  margin-bottom: 2rem;
`;

const BentoGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(12, 1fr);
  gap: 1.5rem;
  margin-top: 3rem;
`;

const BentoCard = styled(motion.div)`
  background: rgba(0, 255, 255, 0.05);
  border: 2px solid #00FFFF;
  border-radius: 12px;
  padding: 2rem;
  transition: all 0.3s ease;
  text-align: center;
  box-shadow: 0 0 10px rgba(0, 255, 255, 0.5),
              inset 0 0 20px rgba(0, 255, 255, 0.1);

  &:hover {
    background: rgba(0, 255, 255, 0.1);
    border-color: white;
    box-shadow: 0 0 15px rgba(0, 255, 255, 0.6),
                inset 0 0 30px rgba(0, 255, 255, 0.2);
  }
`;

const MainCard = styled(BentoCard)`
  grid-column: span 12;
  text-align: center;
  padding: 3rem;
`;

const MissionCard = styled(BentoCard)`
  grid-column: span 6;

  @media (max-width: ${({ theme }) => theme.breakpoints.mobile}) {
    grid-column: span 12;
  }
`;

const WhatWeDoGrid = styled.div`
  grid-column: span 12;
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 1.5rem;
  margin-top: 2rem;

  @media (max-width: ${({ theme }) => theme.breakpoints.mobile}) {
    grid-template-columns: 1fr;
  }
`;

const CardTitle = styled.h3`
  font-size: 1.75rem;
  color: #00FFFF;
  margin-bottom: 1rem;
`;

const CardText = styled.p`
  color: rgba(255, 255, 255, 0.9);
  line-height: 1.6;
  margin-bottom: 1rem;
  text-align: left;
`;

const WhyChooseGrid = styled.div`
  grid-column: span 12;
  display: grid;
  grid-template-columns: repeat(5, 1fr);
  gap: 1rem;
  margin-top: 2rem;

  @media (max-width: ${({ theme }) => theme.breakpoints.mobile}) {
    grid-template-columns: 1fr;
  }
`;

const GlowBackground = styled.div`
  position: absolute;
  width: 100%;
  height: 100%;
  top: 0;
  left: 0;
  background: 
    radial-gradient(circle at 20% 20%, rgba(255, 255, 255, 0.3) 0%, transparent 60%),
    radial-gradient(circle at 80% 80%, rgba(255, 255, 255, 0.3) 0%, transparent 60%),
    radial-gradient(circle at 50% 50%, rgba(43, 16, 85, 0.9) 0%, transparent 70%);
  pointer-events: none;
  opacity: 0.4;
  mix-blend-mode: screen;
  filter: blur(30px);
`;

const About = () => {
  return (
    <AboutSection>
      <GlowBackground />
      <Container>
        <Header>
          <Title>About CypherBox</Title>
          <Subtitle>Powering the Future of AI and Cloud Computing</Subtitle>
        </Header>

        <BentoGrid>
          <MainCard>
            <CardText>
              At CypherBox, we're building the infrastructure of tomorrow. Our state-of-the-art data centers 
              are designed to meet the growing demand for high-performance AI computing and scalable cloud 
              storage solutions. With a focus on innovation, reliability, and sustainability, we empower 
              businesses, developers, and educational institutions to achieve more.
            </CardText>
          </MainCard>

          <MissionCard>
            <CardTitle>Our Mission</CardTitle>
            <CardText>
              To revolutionize data center services by providing tailored, high-performance infrastructure 
              that fuels the next wave of technological advancements in AI, machine learning, and cloud computing.
            </CardText>
          </MissionCard>

          <MissionCard>
            <CardTitle>Our Vision</CardTitle>
            <CardText>
              A world where computing power is no longer a bottleneck to innovation. CypherBox aims to be 
              the go-to partner for all industries needing scalable, cost-effective, and secure data solutions.
            </CardText>
          </MissionCard>

          <BentoCard style={{ gridColumn: 'span 12' }}>
            <CardTitle>What We Do</CardTitle>
            <WhatWeDoGrid>
              <BentoCard>
                <CardTitle>High-Performance Computing</CardTitle>
                <CardText>
                  CypherBox specializes in providing robust computing solutions for AI and machine learning 
                  applications. From training complex models to running large-scale simulations, our 
                  infrastructure is built to handle the heaviest workloads.
                </CardText>
              </BentoCard>

              <BentoCard>
                <CardTitle>Cloud Storage Solutions</CardTitle>
                <CardText>
                  We offer scalable and secure cloud storage that grows with your needs. Whether you're a 
                  startup or a large enterprise, our solutions are designed to adapt to your requirements.
                </CardText>
              </BentoCard>

              <BentoCard>
                <CardTitle>Customizable Data Services</CardTitle>
                <CardText>
                  Tailored solutions for enterprises and institutions seeking dedicated resources for 
                  specialized projects.
                </CardText>
              </BentoCard>
            </WhatWeDoGrid>
          </BentoCard>

          <BentoCard style={{ gridColumn: 'span 12' }}>
            <CardTitle>Why Choose CypherBox</CardTitle>
            <WhyChooseGrid>
              {[
                'Localized Expertise',
                'Cost-Effective Solutions',
                'Cutting-Edge Technology',
                'Sustainability at Heart',
                'Seamless Support'
              ].map((item) => (
                <BentoCard key={item}>
                  <CardTitle>{item}</CardTitle>
                </BentoCard>
              ))}
            </WhyChooseGrid>
          </BentoCard>
        </BentoGrid>
      </Container>
    </AboutSection>
  );
};

export default About;
